script: |
  super -f text -I q5642.spq | sort > q5642.out

inputs:
  - name: q5642.spq
    data: |
      SELECT + col0 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NOT ( NULL NOT BETWEEN 21 * col2 AND CAST ( - 21 AS REAL ) * - + col0 / - + col1 ) );
  - name: tab2

outputs:
  - name: q5642.out
    data: |
